  false,\n\t\"url\": null,\n\t\"notes\": \"Methods used were adapted from a \"cookbook\"
  of instructions developed by Kyle Hogref for using IKONOS imagery data to derive
  seafloor elevations in optically clear water. This dataset was derived from high-resolution
  (2 m) imagery from DigitalGlobe's WorldView-2 sensor of the Kaanapali area of Maui,
  Hawaii. Sensor bands 1,2 and 5 (coastal, blue and near IR respectively) were used
  to derive depth information. The method assumes uniform water clarity but deviations
  from that condition made extraction difficult in water greater than 30 m depth in
  the Kaanapali scene used. Results show that biotic material or sediment in the water
  column skewed results shallower if the material has a high albedo and deeper if
  the material has a low albedo. Nearshore areas were significantly less impacted
  in the Kaanapali area, due to the geomorphology of the area and the hi resolution
  and quality of the imagery, allowing visual descrimination of apparent sediment
  in the water column. For presentation purposes the map product shows an Inverse
  Distance Weighted interpolated bathymetry surface, restricted to data within 600
  m of the shoreline.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
